import { Route, BrowserRouter as Router } from "react-router";
import "./App.css";
import Parent from "./components/Parent";
import Child from "./components/Child";

function App() {
  return (
    <div className="App">
      <Parent />
      <Router>
        <Route path="/" Component={Parent}></Route>
        <Route path="/child" Component={Child} />
      </Router>
    </div>
  );
}

export default App;
